import './header.css';

function Header() {
  return (
    <div>
        <header>
      <div class="Logo">
        <img src='./LogoUR.png'/>
      </div>

      <div class="menu">
        <div class="IBox">
            <img src="data:image/png;base64,"/>
            <a href="./Views/Perfil.html">Mi Perfil</a>
        </div>

        <div class="IBox">
          <img src="data:image/png;base64,"/>
        </div>
      </div>
    </header>


    </div>
  );
}

export default Header;
